  headerCard: {
    width: "100%",
    height: "100%",
    backgroundColor: "#232121",
    borderTopLeftRadius: 50,
    borderTopRightRadius: 50,
    paddingBottom: 50,
  },
  x: {
    width: "25%",
    height: "auto",
    backgroundColor: "#000000",
    color: "white",
    justifyContent: "center",
    alignContent: "center",
    paddingLeft: 15,
  },
  filtro: {
    flexDirection: "row",
    marginBottom: 10,

  },
